import React from 'react';
function About(){
	return (
		<div className='container-fluid'>
			<center><h1 className='display-6'>About Us</h1></center>
			<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum nulla metus, faucibus ut aliquam ac, euismod vitae mi. Nullam in efficitur justo, ut gravida lacus. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent vitae leo eu dolor tincidunt pharetra ac in enim. Quisque rutrum sagittis consectetur. Proin feugiat lectus a justo dignissim volutpat. Vestibulum in maximus ipsum, at maximus quam. Aliquam erat volutpat. Sed felis diam, eleifend ut nisi eget, consectetur tincidunt ex. Morbi lobortis eleifend consequat. Nam fringilla mauris eu arcu dignissim, sit amet efficitur arcu viverra. Duis vel justo ut massa efficitur dapibus. Praesent feugiat elit eget lorem cursus mollis.</p>
			<p>Aenean ac rhoncus justo, sit amet dictum quam. Quisque vehicula tellus eu mi rutrum, ac imperdiet elit rutrum. Pellentesque quis ex placerat, tristique erat semper, dictum nisi. Fusce pharetra ipsum a vehicula lacinia. Donec accumsan enim ac lectus gravida, ut dictum nunc venenatis. Maecenas gravida, turpis eu condimentum auctor, augue nisi tristique nisi, et sollicitudin leo mi eget nisl. In fermentum, est non dignissim lacinia, ex metus efficitur lorem, quis aliquet tortor turpis et libero. Donec suscipit magna vitae facilisis aliquam. Nullam eget congue velit. Sed ante elit, condimentum sit amet venenatis et, varius sit amet quam. Vivamus euismod viverra condimentum. Nullam consectetur scelerisque laoreet. Aliquam vulputate efficitur nulla, ut dapibus lacus. Curabitur ultricies lacus ex, at rutrum leo fermentum sit amet.</p>
		</div>
	);
}

export default About;
